import styled from "styled-components";

export const Box = styled.div`
	background-color: #ffffff;
	width: 100%;
	display: flex;
	flex-direction: row;
	justify-content: center;
	align-items: center;
`;

export const Image = styled.img`
width: 100%;
height: 100%;
`
